import {BrowserRouter as Router, Routes,Route ,Link} from "react-router-dom";
import EmpList from "./EmpList";

function App(){
    return(
        <div>
            <Router>
                <Routes>
                    <Route path="/" element={<EmpList/>} />
                </Routes>
            </Router>

        </div>
    )
}
